window.bookSummaryJSON = "<p>All is not right at Breakbattle Academy. And it's not just because the Elites discovered my secret.&nbsp;</p> <p>Cole, Landon, and Michael were never supposed to know. But then, I was also never supposed to forgive them...or fall in love.</p> <p>I'm losing control. I can't stop now. I can't undo what I've done. I came here for one purpose, but I may lose what is most important in the process.</p> <p>And if someone has their way, I will lose everything else.</p> <p>The balance of power is shifting. What began as peaceful protests are spiraling into something more dangerous...even deadly.</p> <p>The Elite Class can't stop what's coming next, but I've sacrificed everything to be one of them.</p> <p>What will my boys have to sacrifice for me?</p> <p><i>The Judgement</i> is a reverse harem high school bully romance. This is year three in the series and features language, dark themes, and sexual scenes. If you're cool with that, dive in!</p>"; 
